import React, { useState } from "react";
import { IQuestion } from "./types";
import "../styles/question.css";

export interface FooterProps {
	question: IQuestion;
}

function UnansweredQuestionFooter(props: FooterProps) {
	const question = props.question;

	return (
		<>
		{
			question.answered
		}
			<div className="note-footer">
				<div className="note-footer-leftside-btn-containers">
				<img className="note-trashcan" src="/buttons/trashcan-btn.svg" alt="" />
				<img
					className="note-collection"
					src="/buttons/collection-btn.svg"
					alt=""
				/>
				</div>
				<div className="note-footer-rightside-btn-containers">

				</div>


			</div>
		</>
	);
}

export default UnansweredQuestionFooter;
